  [],\n\t\"revision_timestamp\": \"2015-05-06T20:56:22.835233\",\n\t\"name\": \"high-speed-thermal-characterization-of-cryogenic-flows-project-0cfc0\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The John C. Stennis Space Center's primary
  mission is testing rocket propulsion systems and components for the Space Shuttle
  and for future generations of space vehicles.  Research to develop new instrumentation
  technologies and techniques for test facility monitoring and control during propulsion
  testing includes the need for instrumentation to improve reliability and performance
  of ground test facilities.  Current sensors can not survive the harsh conditions
  (high pressures and high flow rates) that are required for ground based rocket propulsion
  systems testing.  Luna Innovations proposes to develop a high-speed, cryogenic fiber
  optic temperature sensor housed in a ruggedized, aerodynamic probe to increase sensing
  capabilities for ground-based rocket testing.  Luna will be teaming with the Aerospace
  Department at a partnering university to develop a materials-compatible housing
  designed for survivability in high flow and high pressure cryogenic conditions.
  \ Computational fluid dynamics (CFD) modeling will be conducted to optimize the
  aerodynamic design for frequency response and ruggedization of the sensor and housing.
  \ Special attention will be given to designing smart features into the sensor, such
  as self-diagnostics to monitor sensor health, and on-board storage of calibration
  data.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
